import './App.css';
import Login from './Components/Login/Login.js';
import { useEffect, useState } from 'react';
import {BrowserRouter, Route, Routes} from 'react-router-dom';
import ProtectedRoute from './Components/ProtectedRoute/ProtectedRoute';
import Cadastro from './Paginas/Cadastro/Cadastro.js';
import CadastroMotor from './Paginas/Cadastro/CadastroMotor/CadastroMotor.js';
import CadastroCabos from './Paginas/Cadastro/CadastroCabos/CadastroCabos.js';
import CadastroMaterial from './Paginas/Cadastro/CadastroMaterial/CadastroMaterial.js';
import Dimensionamento from './Paginas/Dimensionamento/Dimensionamento.js';
import Header from './Components/Header/Header.js';
import ListaComponentes from './Paginas/ListaComponentes/ListaComponentes.js';
import ListaComponentesMotor from './Paginas/ListaComponentes/ListaComponentesMotor/ListaComponentesMotor.js';
import ListaComponentesCabos from './Paginas/ListaComponentes/ListaComponentesCabos/ListaComponentesCabos.js';
import ListaComponentesMaterial from './Paginas/ListaComponentes/ListaComponentesMateriais/ListaComponentesMateriais.js';

/**
 * Estado que salva a informação se o usuario esta logado ou não para definir se o usuario pode ou não acessar as rotas.
 * @typedef {EstadoReact} SituacaoLogin
 * @property {boolean} SituacaoLogin True o usuario esta logado e false o usuario não esta logado.
 * @property {React.Dispatch<React.SetStateAction<boolean>>} setSituacaoLogin Função responsável por atualizar o valor do estado SituacaoLogin.
 */

/**
 * Estado que guarda o valor da localStorage 'Login'.
 * @typedef {EstadoReact} LoginLocalStorage
 * @property {object} LoginLocalStorage Objeto contendo os dados de usuario e senha do usuario logado que esta salvo no localStorage 'Login'.
 * @property {React.Dispatch<React.SetStateAction<object>>} setLoginLocalStorage Função responsável por definir novo valor par ao estado LoginLocalStorage.
 */

/**
 * Componente principal App responsavel por renderizar as outras rotas.
 * @returns {JSX.Element} Componente App responsavel por englobar todas as rotas da aplicação.
 */
function App() {

  const [SituacaoLogin, setSituacaoLogin] = useState(false)
  const [LoginLocalStorage,setLoginLocalStorage] = useState(JSON.parse(localStorage.getItem('Login')) || [])


  /** Toda vez que o estado LoginLocalStorage é alterado faz a conferencia dos dados da localStorage 'Login' para verificar se os dados condizem com as iformações de login que estão no backend, caso condiz retornara true e definira o estado SituacaoLogin como true informando que o usuario esta logado. */
    useEffect(() => {

      async function confereLoginLocalStorage(){
        const loginStorage = JSON.parse(localStorage.getItem('Login'))
        if(loginStorage){
          const url = process.env.REACT_APP_BACKEND_URL
          await fetch(`${url}/autorizacao/dimensionamentoEletrica`,{ method: 'POST',
          headers: {
            accept: 'application/json',
            'content-type': 'application/json'
          },
          body : JSON.stringify({ usuario : loginStorage.usuario, senha: loginStorage.senha  })

      }).then(response => response.json())
      .then(data => {
        if(data === true) {
          setSituacaoLogin(true)
        }else{
          setSituacaoLogin(false)
          window.alert('Login incorreto, caso esqueceu a senha contatar o administrador.')
        }
      });
        }
        }
      confereLoginLocalStorage()
    },[setSituacaoLogin, LoginLocalStorage])

  return (
    <div className="App">
      {
       SituacaoLogin === true ? <Header setSituacaoLogin={setSituacaoLogin}></Header>: ''
      }
      <BrowserRouter>
        <Routes>
          <Route path="/"  element={<Login setLoginLocalStorage={setLoginLocalStorage} LoginLocalStorage={LoginLocalStorage} SituacaoLogin ={SituacaoLogin} />} />
          <Route path="/cadastro" element={<ProtectedRoute component={Cadastro} isAuthenticated={SituacaoLogin} />} />
          <Route path="/cadastro/motor" element={<ProtectedRoute component={CadastroMotor} isAuthenticated={SituacaoLogin} />} />
          <Route path="/cadastro/cabos" element={<ProtectedRoute component={CadastroCabos} isAuthenticated={SituacaoLogin} />} />
          <Route path="/cadastro/materiais" element={<ProtectedRoute component={CadastroMaterial} isAuthenticated={SituacaoLogin} />} />
          <Route path="/listaComponentes" element={<ProtectedRoute component={ListaComponentes} isAuthenticated={SituacaoLogin} />} />
          <Route path="/listaComponentes/motor" element={<ProtectedRoute component={ListaComponentesMotor} isAuthenticated={SituacaoLogin} />} />
          <Route path="/listaComponentes/cabos" element={<ProtectedRoute component={ListaComponentesCabos} isAuthenticated={SituacaoLogin} />} />
          <Route path="/listaComponentes/materiais" element={<ProtectedRoute component={ListaComponentesMaterial} isAuthenticated={SituacaoLogin} />} />
          <Route path="/dimensionamento" element={<ProtectedRoute component={Dimensionamento} isAuthenticated={SituacaoLogin} />} />
          {/* Outras rotas protegidas */}
        </Routes>
      </BrowserRouter>
    </div>
  );

}

export default App;

import styled from "styled-components";

/**
 * Styled-componente de botão estilizável com animação de mover 2px no eixo Y quando clicado e aumenta escala em 1.05 quando mouse esta em cima.
 * @property {object} props Props React
 * @property {string} props.color Define a cor da fonte. Valor padrão 'black'.
 * @property {string} props.backgroundcolor Define a cor de fundo do componente.Valor padrão 'white'.
 * @property {string} props.border_radius Define o raio de curvatura dos cantos do componente. Valor padrão '0px'.
 * @property {string} props.width Define o comprimento do componente. Valor padrão '100%'.
 * @property {string} props.border Define o estilo da borda do componente. Valor padrão '0px'.
 * @property {string} props.padding Define o espaçamento interno do componente. Valor padrão '0px 0px'.
 * @property {string} props.margin Define o espaçamento externo do componente. Valor padrão '0px 0px'. 
 * @property {string} props.font_size Define o tamanho da fonte. Valor padrão '14px'.
 * @property {string} props.boxshadow Define a sombra do componente. Valor padrão '0px 0px 0px'.
 * @property {string} props.colorHover Define a cor do texto quando o mouse esta em cima do componente.
 * 
 * @example
 * <Botao color='orange' backgroundcolor='blue' border='1px solid black' border_radius='2.5px' />
 */
const Botao = styled.button`
    color: ${props=> props.color || 'black'};
    background-color: ${props=> props.backgroundcolor || 'white'};
    border-radius: ${props=> props.border_radius || '0px'};
    width: ${props=> props.width ||'100%'};
    border: ${props=> props.border || '0px'};
    padding: ${props=> props.padding || '0px 0px'};
    margin: ${props => props.margin || '0px 0px'};
    font-size: ${props => props.font_size|| '14px'};
    box-shadow : ${props => props.boxshadow || '0px 0px 0px'};
    cursor:pointer;
    transition: transform 0.2s;
    &:active {
        transform: translateY(2px);
      }
    &:hover {
        transform: scale(1.05);
        color:${props=>props.colorHover || props.color}
    }
`

export default Botao

import styled from "styled-components"
import Label from "../Label/Label"
import Input from "../Input/Input"
import Titulo4 from "../Titulo4/Titulo4"
import { VerificaSeNumeroInteiroEMaiorQueZero } from "../../Helpers/VerificaSeNumeroInteiroEMaiorQueZero"
import { VerificaSeNumeroMaiorQueZero } from "../../Helpers/VerificaSeNumeroMaiorQueZero"

/** Styled-component de section que engloba componentes do formulario de dados sobre alimentação do galpão. */
const DimensionamentoSection = styled.section`
display:flex;
flex-direction:column;
width:70%;
padding:1rem 1rem;
background-color:black;
border:0.5px orange solid;
border-radius:30px;
align-items:center;
margin: 1rem 0px;
`

/** Styled-component de div que organiza os componentes em linha um ao lado do outro. */
const FormDivLinha = styled.div`
    display:flex;
    align-items:center;
    justify-content:space-between;
    margin: 0.5rem 0px;
    width:100%;
`

/** Styled-component de div que engloba cada item do formulario com Label da pergunta e inputs abaixo. */
const FormDiv = styled.div`
    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:space-between;
    margin:0 1rem;
    width:100%;
    border:orange 0.1px solid;
    border-radius:10px;
    padding:10px 10px;
`

/**
 * Componente de formulario que pega os dados sobre alimentação na pagina de dimensionamento.
 * @param {object} props Props do componente React
 * @param {object} props.todosDadosAlimentacao Objeto com os estados react utilizados neste componente que foram passados como propriedade deste componente a partir do componente dimensionamento.
 * @param {React.Dispatch<React.SetStateAction<number>>} props.todosDadosAlimentacao.setQuantidadeLinhasPrimarias Função responsável por definir novo valor para o estado QuantidadeLinhasPrimarias.
 * @param {React.Dispatch<React.SetStateAction<number>>} props.todosDadosAlimentacao.setPotenciaLinhas Função responsável por definir novo valor para o estado PotenciaLinhas.
 * @param {React.Dispatch<React.SetStateAction<number>>} props.todosDadosAlimentacao.setQuantidadeComedouros Função responsável por definir novo valor para o estado QuantidadeComedouros.
 * @param {React.Dispatch<React.SetStateAction<number>>} props.todosDadosAlimentacao.setPotenciaComedouros Função responsável por definir novo valor para o estado PotenciaComedouros.
 * @param {number} props.todosDadosAlimentacao.QuantidadeLinhasPrimarias Estado responsável por guardar o valor do input de quantidade de linhas primarias.
 * @param {number} props.todosDadosAlimentacao.PotenciaLinhas Estado responsável por guardar o valor do input de potencia das linhas primarias.
 * @param {number} props.todosDadosAlimentacao.QuantidadeComedouros Estado responsável por guardar o valor do input de quantidade de comedouros.
 * @param {number} props.todosDadosAlimentacao.PotenciaComedouros Estado responsável pro guardar o valor do input de potencia dos comedouros.
 * @returns {JSX.Element}  Componente com inputs que captam informações sobre alimentação do galpão.
 */
function DimensionamentoAlimentacao({todosDadosAlimentacao}){

    /** Caso o valor do input de quantidade de linhas primarias sejá inteiro e maior ou igual a 0 define o estado QuantidadeLinhasPrimarias com o valor do input. */
    function HandleQuantidadeLinhasPrimarias(event){
        const valor = event.target.value
        if(VerificaSeNumeroInteiroEMaiorQueZero(valor)){
            todosDadosAlimentacao.setQuantidadeLinhasPrimarias(valor)
        }
    }

    /** Caso o valor do input de potencia das linhas seja maior ou igual a 0 define o valor do estado PotenciaLinhas com o valor do input. */
    function HandlePotenciaLinhas(event){
        const valor = event.target.value.replace(',','.')
        if(VerificaSeNumeroMaiorQueZero(valor)){
            todosDadosAlimentacao.setPotenciaLinhas(valor)
        }
    }

    /** Caso o valor do input de quantidade de comedouros seja inteiro e maior ou igual a 0 define o estado QuantidadeComedouros com o valor do input. */
    function HandleQuantidadeComedouros(event){
        const valor = event.target.value
        if(VerificaSeNumeroInteiroEMaiorQueZero(valor)){
            todosDadosAlimentacao.setQuantidadeComedouros(valor)
        }
    }

    /** Caso o valor do input de potencia dos comedouros sejá maior ou igual a 0 define o estado PotenciaComedouros com o valor do input. */
    function HandlePotenciaComedouros(event){
        const valor = event.target.value.replace(',','.')
        if(VerificaSeNumeroMaiorQueZero(valor)){
            todosDadosAlimentacao.setPotenciaComedouros(valor)
        }
    }


    return(
        <DimensionamentoSection>
                <Titulo4 color="orange" font_size='32px'>Alimentação</Titulo4>
                <FormDivLinha>
                <FormDiv>
                <Label font_size='16px' translate="0px" color="orange" text_align='left' width='100%'>Linha Primária:</Label>
                <FormDivLinha>
                <Input  type="number" onWheel={(e) => e.target.blur()} required  onChange={HandleQuantidadeLinhasPrimarias} value={todosDadosAlimentacao.QuantidadeLinhasPrimarias} padding='20px 20px' width='40%' border='orange 0.5px solid' border_radius='10px' placeholder="Quantidade Linhas"></Input>
                <Input  type="number" onWheel={(e) => e.target.blur()} required  onChange={HandlePotenciaLinhas} value={todosDadosAlimentacao.PotenciaLinhas} padding='20px 20px' width='40%' border='orange 0.5px solid' border_radius='10px' placeholder="Potência em CV"></Input>
                </FormDivLinha>
                </FormDiv>
                <FormDiv>
                <Label font_size='16px' translate="0px" color="orange" text_align='left' width='100%'>Comedouros:</Label>
                <FormDivLinha>
                <Input  type="number" onWheel={(e) => e.target.blur()} required onChange={HandleQuantidadeComedouros} value={todosDadosAlimentacao.QuantidadeComedouros} padding='20px 20px' width='40%' border='orange 0.5px solid' border_radius='10px' placeholder="Quantidade Comedouros"></Input>
                <Input  type="number" onWheel={(e) => e.target.blur()} required  onChange={HandlePotenciaComedouros} value={todosDadosAlimentacao.PotenciaComedouros} padding='20px 20px' width='40%' border='orange 0.5px solid' border_radius='10px' placeholder="Potência em CV"></Input>
                </FormDivLinha>
                </FormDiv>
                </FormDivLinha>
                
            </DimensionamentoSection>
    )
}


export default DimensionamentoAlimentacao

