    useEffect(()=>{
        async function pegarDadosCabos(){
            const option ={
                method: 'POST',
                headers: {
                  accept: 'application/json',
                  'content-type': 'application/json'
                },
                body: JSON.stringify({
                    object_type: '7os9af81a3do34vuqnh7j',
                    sort: 'codigo',
                    page: 1,
                    size: '10000'
                  })
            }
            const response = await fetch(`${process.env.REACT_APP_BACKEND_URL}/api/jestor/lista`, option);
