            ></Input>
            </PesquisaContainer>
            <Titulo2 color="orange">Cabos :</Titulo2>

            {
                TodosCabos !== '' && TodosCabos.length > 0 ? TodosCabos.map((cabo,index) => (
                    <ItemContainer key={index}>
                        <Item>
                            <Titulo4>Código</Titulo4>
