                            <span>{motor.ligacao_tensao_media}V</span>
                        </Item>
                        <Item>
                            <Titulo4>Lig. Ten. Alta</Titulo4>
                            <span>{motor.ligacao_tensao_alta}V</span>
                        </Item>
                        <Item>
                            <Titulo4>Corrente Lig. Baixa</Titulo4>
